package ViewVO;

public class VideoRecipeViewVO {
	private String postCode;
	private String recipeCode;
	private String videoRecipeCode;
	private String videoName;
	private String completeImage;
	private String recipeName;
	private String recipeDescription;
	private String personNumber;
	private String cookingTime;
	private String cookingLevel;
	private String videoUrl;
	private String likeCount;
	private String postHits;
	private String postHashTag;
	public VideoRecipeViewVO() {
		// TODO Auto-generated constructor stub
	}
	public VideoRecipeViewVO(String postCode, String recipeCode,
			String videoRecipeCode, String videoName, String completeImage,
			String recipeName, String recipeDescription, String personNumber,
			String cookingTime, String cookingLevel, String videoUrl,
			String likeCount, String postHits, String postHashTag) {
		this.postCode = postCode;
		this.recipeCode = recipeCode;
		this.videoRecipeCode = videoRecipeCode;
		this.videoName = videoName;
		this.completeImage = completeImage;
		this.recipeName = recipeName;
		this.recipeDescription = recipeDescription;
		this.personNumber = personNumber;
		this.cookingTime = cookingTime;
		this.cookingLevel = cookingLevel;
		this.videoUrl = videoUrl;
		this.likeCount = likeCount;
		this.postHits = postHits;
		this.postHashTag = postHashTag;
	}
	public String getPostCode() {
		return postCode;
	}
	public void setPostCode(String postCode) {
		this.postCode = postCode;
	}
	public String getRecipeCode() {
		return recipeCode;
	}
	public void setRecipeCode(String recipeCode) {
		this.recipeCode = recipeCode;
	}
	public String getVideoRecipeCode() {
		return videoRecipeCode;
	}
	public void setVideoRecipeCode(String videoRecipeCode) {
		this.videoRecipeCode = videoRecipeCode;
	}
	public String getVideoName() {
		return videoName;
	}
	public void setVideoName(String videoName) {
		this.videoName = videoName;
	}
	public String getCompleteImage() {
		return completeImage;
	}
	public void setCompleteImage(String completeImage) {
		this.completeImage = completeImage;
	}
	public String getRecipeName() {
		return recipeName;
	}
	public void setRecipeName(String recipeName) {
		this.recipeName = recipeName;
	}
	public String getRecipeDescription() {
		return recipeDescription;
	}
	public void setRecipeDescription(String recipeDescription) {
		this.recipeDescription = recipeDescription;
	}
	public String getPersonNumber() {
		return personNumber;
	}
	public void setPersonNumber(String personNumber) {
		this.personNumber = personNumber;
	}
	public String getCookingTime() {
		return cookingTime;
	}
	public void setCookingTime(String cookingTime) {
		this.cookingTime = cookingTime;
	}
	public String getCookingLevel() {
		return cookingLevel;
	}
	public void setCookingLevel(String cookingLevel) {
		this.cookingLevel = cookingLevel;
	}
	public String getVideoUrl() {
		return videoUrl;
	}
	public void setVideoUrl(String videoUrl) {
		this.videoUrl = videoUrl;
	}
	public String getLikeCount() {
		return likeCount;
	}
	public void setLikeCount(String likeCount) {
		this.likeCount = likeCount;
	}
	public String getPostHits() {
		return postHits;
	}
	public void setPostHits(String postHits) {
		this.postHits = postHits;
	}
	public String getPostHashTag() {
		return postHashTag;
	}
	public void setPostHashTag(String postHashTag) {
		this.postHashTag = postHashTag;
	}
	
	
	

}
